message:
➡️ "O que temos hoje é um capitalismo global, anticristão, que concentra a propriedade e a riqueza em poucas mãos, que devasta as economias nacionais, que impede o livre desenvolvimento desse mercado ideal (hoje puramente hipotético), que está destruindo a possibilidade da pequena propriedade e do trabalho decente. O capitalismo hoje é deslocalização, é especulação com matérias-primas, é a devastação do tecido produtivo nacional, é a impossibilidade de você montar seu pequeno negócio e ter um emprego com perspectiva de promoção."

- Juan Manuel de Prada

@flamaverdenacionalista
